INSERT INTO `mq_cuser_info` VALUES (6,8,'成都浩石科技有限公司','0','0','0',0,'0','0','101','101','成都浩石科技有限公司成立于2008年，是一家致力于互动电视行业和移动应用开发的科技公司。服务于党员远程教育、地方社会治理、民生公益，全面服务于党委、地方政府和人民群众。秉承“诚信为本、创新为魂”的精神理念，立志为党和人民群众提供更加优质和高效的服务。',0,'0','0',101),(5,7,'成都艾薇尼尔信息技术有限公司','0','0','0',0,'0','0','101','101','成都艾薇尼尔信息技术有限公司成立2016年，公司位于成都天府三街219号腾讯大楼B座，是一家正在充满梦想和创新精神的创业公司，在互联网时代我公司应运而生，开发的微信会员管理系统，将传统实体会员卡以电子卡的形式存放在微信的卡包中。通过使用我们的系统让商家具备会员管理功能、营销功能、收银功能。让每一位传统商家接入互联网，积攒消费者大数据。',0,'0','0',101),(7,9,'成都金隧自动化工程有限责任公司','0','0','0',0,'0','0','101','101',' 成都金隧自动化工程有限责任公司成立于2000年3月，注册资金800万，是成都博士创业园的首批入园企业，是专业从事机电设备自动化监控系统研发、设计、生产、销售、安装、维护为一体的国家高新技术开发区“高新技术企业”，公司依托西南交通大学，技术力量雄厚，人力资源丰富、研发试验设施齐全。',0,'0','0',101),(8,10,'成都康特电子高新科技有限责任公司','0','0','0',0,'0','0','101','101','成都康特（电子）集团公司是专业从事广播电视设备（含CATV及宽带网络设备）产品的研发、生产、销售、工程设计、安装及服务的国家级高新科技企业。\r\n主要产品有：广播电视前端、无线发射设备、电视及数据传输设备、电视光纤传输设备及数据光纤传输设备，光纤无源器材、器件等系列设备（产品）。\r\n公司自1992年成立以来，经多年艰苦创业，以高科技为本、高品质立业不断发展，一直处于高成长态势；公司培养锻炼出了理论深厚、经验丰富、敢于探索的科研队伍、一批现代经营管理队伍和生产工艺严谨的员工队伍。\r\n',0,'0','0',101),(9,11,'成都廖记企业管理有限公司','0','0','0',0,'0','0','101','101',' 1993年，棒棒鸡非遗技艺第五代代表性传承人李良锋将棒棒鸡美食带到成都，并创立廖记棒棒鸡连锁品牌，开启了棒棒鸡美食的品牌扩张之路。\r\n     历经20余年的发展，以非遗棒棒鸡美食为代表的食品集团——成都良丰投资管理有限公司已成为国内具有影响力的食品集团，旗下拥有3大熟食连锁门店品牌——棒棒鸡传奇，卤智深，廖记棒棒鸡；调味品品牌川味记忆复合调味料，岩槽头中华贡椒，新鲜熟食品牌良丰鲜食坊，卤智深，形成以门店经营为龙头，电商、商超齐头并进的集团化发展格局。\r\n     其经营的廖记棒棒鸡（现已升级为棒棒鸡传奇）熟食连锁品牌风靡全国，在全国拥有直营、加盟店1000余家，是熟食连锁特许经营的金字招牌。先后先后获“中国知名品牌”、“巴蜀名牌”、“四川市场畅销品牌”、“四川群众喜爱品牌”、“川菜名菜”等荣誉称号，并被国务院扶贫办、中国扶贫基金会、《中国财富》杂志四川工作站联合授予“民生创富”联谊单位。\r\n',0,'0','0',101),(10,12,'成都市优源聚科技有限公司','0','0','0',0,'0','0','101','101','成都市优源聚科技有限公司主要从事直接投资文化艺术新媒体、艺术教育培训、在线教育、新型工业化产业项目投资、开发、运营与管理。受托省经信委主管产业促进会会员单位的企业策划、规划，受托资产管理、金融服务、融资租赁等有偿服务。公司总部设立于具有“天府之国”之称的成都，成立至今，公司项目稳步发展，业务范围不断扩展。',0,'0','0',101),(11,13,'天伦美','0','0','0',0,'0','0','101','101','天伦美装饰公司致力于为客户提供高性价比的一站式装修，现有甲级办公楼、一站式材料展厅、设计团队和专业的施工队伍多次获奖，工程质量达到国家质量评定标准。',0,'0','0',101),(12,14,'成都网络云科技有限公司','0','0','0',0,'0','0','101','101','成都网络云科技有限公司致力于为大中型企业提供网络整合营销、网络品牌传播、网络广告策划、网络公关等服务于一体的专业网络营销管理与投资公司，是行业内首屈一指的企业。',0,'0','0',101),(13,15,'成都为极科技有限公司','0','0','0',0,'0','0','101','101','成都为极科技有限公司是全国领先的手机主题服务提供商。\r\n公司为全球近30个国家和地区的智能手机客户提供手机主题服务，让全世界智能手机用户界面享有美观、个性、潮流等全方位服务。\r\n公司与华为，三星，OPPO，vivo，小米，乐视，魅族等10多家主题市场密切合作。\r\n公司长期保持各大主题付费市场TOP3，在魅族，联想市场多次获得TOP1，入驻启迪之星孵化器后，陆续开通的6家新市场，全部进入TOP10，并且获得三星年度主题票选第一的成绩！\r\n公司单款产品，下载量突破100万次，全线主题累计下载量图片数百万次。\r\n目前公司拥有8项GUI设计界面专利，多套设计，著作版权。\r\n',0,'0','0',101),(14,16,'成都无敌勇士科技有限公司','0','0','0',0,'0','0','101','101','成都为极科技有限公司是全国领先的手机主题服务提供商。\r\n公司为全球近30个国家和地区的智能手机客户提供手机主题服务，让全世界智能手机用户界面享有美观、个性、潮流等全方位服务。\r\n公司与华为，三星，OPPO，vivo，小米，乐视，魅族等10多家主题市场密切合作。\r\n公司长期保持各大主题付费市场TOP3，在魅族，联想市场多次获得TOP1，入驻启迪之星孵化器后，陆续开通的6家新市场，全部进入TOP10，并且获得三星年度主题票选第一的成绩！\r\n公司单款产品，下载量突破100万次，全线主题累计下载量图片数百万次。\r\n目前公司拥有8项GUI设计界面专利，多套设计，著作版权。\r\n',0,'0','0',101),(15,17,'成都西宇汇智科技有限公司','0','0','0',0,'0','0','101','101','成都西宇汇智科技有限公司',0,'0','0',101),(16,18,'成都喜铺良缘婚庆服务有限责任公司','0','0','0',0,'0','0','101','101','懂懂婚礼科技，成立于2015年12月，主要从事网络工具¬研究和开发、运营。\r\n    2016年9月，在“互联网+婚礼”大环境¬¬¬孕育下，为了解决行业内“新人找不到商家，商家看不到用户”的痛点，懂懂科技旗下第一款婚庆行业的产品“懂懂婚礼APP“温情上线，首推“滴滴版婚礼”全新婚庆理¬念，主打婚礼方案，意在打通新人与商家之间的壁垒，势必将在整个婚庆行业掀起一场重大变革。\r\n    懂懂婚礼APP，汇聚海量商家真实案例，让你足不出户即可感受婚礼现场氛围，清新的活泼的高贵的文艺的校园的森林的明场的暗场的酒店的草坪的，风格各异，千姿百态，总有一款和你梦中的婚礼相吻合！产品上线当天起，懂懂婚礼在线发放600亿婚礼券，新用户注册即领1000元婚礼劵，邀请亲朋好友注册还可以额外获得200元/人次婚礼劵；商家入驻发放100亿补贴，引爆全球华人婚庆市场。\r\n',0,'0','0',101),(17,19,'成都瑶璐广告有限公司','0','0','0',0,'0','0','101','101','成都瑶璐广告有限公司（CHANC，取议于“Change改变”和“Chance机会\"的结合）成立于2006年，长期服务于国内外奢侈品、汽车、航空、工业、房地产、IT、通讯、快消品类客户，对于中国不同阶层的消费市场需求和客户服务的品质要求有着深刻的理解。\r\n我们拥有丰富的项目运作经验、专业的执行力、广泛的跨品牌合作关系、强势的媒体资源和一支强有力的整合服务团队，为客户在市场传播中赢得先机。\r\n',0,'0','0',101),(18,20,'成都易知企业管理有限公司','0','0','0',0,'0','0','101','101','成都易知企业管理公司是一家专注餐饮咨询辅导，为餐饮企业提供定制化服务的公司。\r\n公司拥有前沿的餐饮管理理念、一流的项目专家团队、一对一的辅导方式，秉承“贡献专业价值、助力企业成长”的服务理念，致力于为餐饮企业提供咨询、辅导、项目实施和落地、企业顾问等服务，为餐饮企业搭建互动交流的平台，推进餐饮企业稳健发展。\r\n',0,'0','0',101),(19,21,'成都渔果科技有限公司','0','0','0',0,'0','0','101','101','成都渔果科技有限公司主要致力于APP开发、O2O营销、智能WIFI路由器研发，大数据分析。团队技术核心成员来自华为、阿尔卡特.朗讯、迈普通信，锐捷网络、WIPRO、腾讯等国内外知名企业，具有10年路由器研发经验。市场团队来自：阿里巴巴，大众点评网，百度，美团等知名互联网企