INSERT INTO `mq_cuser_post` VALUES (16,8,'3','Web前端开发工程师','1. 熟悉掌握基于HTML5的webApp开发以及各种手机移动端适配， 熟悉ECMA标准，熟练掌握DOM、BOM操作；</br>\n2. 具备两年以上工作经验；</br>\n3. 熟练使用原生JS、HTML5/CSS3、Ajax，jquery等前端开发技术及框架；</br>\n4. 有至少一年与移动端APP协作开发的工作经验，熟悉其交互方式；</br>\n5. 有vue开发经验的优先考虑；</br>\n\n（面试建议）</br>\n一年经验以上，公司特别注重APP开发经验。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(15,7,'2','测试工程师','1.计算机及相关专业，大专以上学历。</br>\n2. 掌握系统的计算机知识，掌握软件测试原理，测试方法和工具，有强烈的软件质量意识</br>\n3. 思路清晰，善于表达，强烈的责任感和良好的工作习惯，学习能力强；</br>\n4. 熟悉智能手机及互联网，有良好的人机交互及用户体验意识</br>\n5. 有良好的文档写作能力</br>\n6. 有数据库，Java，WEB应用经验的优先</br>\n（面试建议）</br>\n1.要有写作能力；</br>\n2.懂人机交互，有用户体验意识；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(14,7,'1','web前端','1、1年以上Web前端开发经验，熟练掌握H5技术；</br>\n2、熟悉HTML/XHTML、CSS等网页制作技术，熟悉页面架构和布局，能够解决各种浏览器兼容性问题；</br>\n3、精通JavaScript、Ajax，熟练掌握ES6、Sass或Less；</br>\n4、熟练使用Vue框架开发，使用过webpack；</br>\n5、必须会小程序；</br>\n6、具备良好的团队合作精神、较好的沟通能力、高度的责任感，具有较强的抗压能力；</br>\n（面试建议）</br>\n1.有后端开发或者协同工作的优先考虑；</br>\n2.小程序是硬性要求；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(17,8,'4','UI设计 3k-4k','1、大专及以上学历，美术、设计等相关专业优先，具有良好的美术功底和界面设计能力；\r\n2、精通Photoshop、Illustrator、CDR等相关设计软件；\r\n3、优秀的审美能力，对配色、线条等元素敏感；\r\n4、配合设计PC端、移动端、IPTV端等的视觉设计\r\n\r\n（面试建议）\r\n面试请带上简历及作品；\r\nCDR是硬性要求哦！\r\n','',510000,101,101,101,0,1500000000,1509999999),(18,9,'5','C++软件开发                 6001-8000','1、计算机软件相关专业或通信、数学专业本科学历以上, 有浓厚的软件开发兴趣, 踏实肯学, 奋发上劲, 学习和动手能力强</br>\n\n2、从事软件开发或类似工作经历一年以上, 熟练C\\C++种编程语言编程, 能在Windows下使用VC/VS编写C++程序（MFC），有各类大中小型软件、软件模块开发经验者优先</br>\n\n3、有较强逻辑思维能力,熟悉数据结构、数据库SQL、面向对象模型开发方法</br>\n\n（面试建议）</br>\n试用期1-3月，一年以上工作经验，</br>\n','',510000,101,101,101,0,1500000000,1509999999),(19,9,'6','WEB前后端开发工程师           3000-8000','1、计算机软件相关专业或通信、数学专业专科以上, 有浓厚的软件开发兴趣, 踏实肯学, 奋发上劲, 学习和动手能力强</br>\n2、从事软件开发或类似工作经历一年以上, 精通(X)HTML、CSS，熟悉页面架构和布局，对Web标准和标签语义化有较深入理解</br>\n3、熟悉JavaScript、Ajax、Dom等前端技术</br>\n4) 熟悉ExtJS、Jquery、Bootstrap等一种或多种前端开发框架</br>\n5、熟悉C#后端开发，掌握面向对象编程思想</br>\n\n（面试建议）</br>\n有美工基础会使用PhotoShop</br>','',510000,101,101,101,0,1500000000,1509999999),(20,10,'7','Web前端软件工程师      4000-6000','1、熟练掌握html、css、javascript、ajax、jquery等前端技术；</br>\n2、熟练掌握react.js、vue.js等前端框架开发；</br>\n3、有2年及以上Web前端开发经验；</br>\n4、有独立项目设计和开发经验者优先；</br>\n5、计算机及相关专业者优先；</br>\n6、了解前端GIS开发者优先；</br>\n7、有广电或电信行业运维管理经验者优先；</br>\n8、熟悉.NET或JAVA开发者优先；</br>\n\n（面试建议）</br>\n能按照业务设计完成详细设计、编码实现、单元测试和集成测试；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(21,10,'8','C/C++软件工程师 （音视频产品开发方向）','1、熟练掌握FFMPEG开发；</br>\n2、熟练掌握RTP、RTSP、RTMP，TCP、UDP等网络协议开发；</br>\n3、有2年及以上C/C++开发经验；</br>\n4、熟悉掌握多线程编程，具有扎实的数据结构基础。</br>\n4、有独立项目设计和开发经验者优先；</br>\n5、计算机、通信、软件、数学及相关专业；</br>\n7、有广电或电信行业运维管理经验者优先；</br>\n8、熟悉.NET或JAVA开发者优先；</br>\n\n（面试建议）</br>\n音视频产品开发方向，两年以上经验。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(22,11,'9','电商平台美工    1人      4000-6000','1、美术、平面设计相关专业，1年以上电商美工经验</br>\n2、有扎实的美术功底、良好的创意思维和理解能力；</br>\n3、精通Photoshop 、Coreldraw、Illustrator等相关设计软件；</br>\n4、能独立完成设计工作，并有并有良好的审美及色彩感觉；</br>\n\n(面试建议)</br>\n1、有淘宝，天猫美工工作经验者优先考虑；</br>\n2、应聘者请带个人设计作品(案例网址及其相关作品）</br>','',510000,101,101,101,0,1500000000,1509999999),(23,12,'10','Web前端          1人          2001-4000','1、有1年半以上相关工作经验，</br>\n2、会使用Photoshop、AI、CorelDraw、Flash等图形软件；</br>\n3、熟练使用Dreamweaver / WebStorm等网页制作工具；</br>\n4、精通并能熟练编写HTML/CSS/JS/Ajax/Json等，能够独立完成动态和静态网页制作；</br>\n5、参与过项目完整过程的开发，并能提供相关作品；</br>\n\n（面试建议）</br>\n1、会HTML5，能利用H5制作动画</br>\n2、熟悉PHP后台程序开发</br>\n3、了解移动APP开发的UI设计</br>\n这样的你一个是全才。。。。。。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(24,12,'11','PHP开发工程师      1人      3500-5000','1、爱好程序开发，有独立开发网站经验，熟悉MVC框架，熟悉各种CMS；</br>\n2、熟悉Jquery、Ajax、Json、CSS、HTML，能熟练编写PHP、JavaScript等；</br>\n3、手里至少掌握一种PHP开发模板引擎和一种PHP开发框架(如：ThinkPhp)；</br>\n4、能熟练使用MySQL，并且熟悉SQL Server、Oracle等其他类型数据库；</br>\n5、参与过项目完整过程的开发，有过相关作品展示和相关项目经验；</br>\n\n（面试建议）</br>\n1、熟悉前端开发且也能编写HTML+CSS</br>\n2、有微信微站开发经验者，熟悉各种接口</br>\n','',510000,101,101,101,0,1500000000,1509999999),(25,13,'12','WEB前端设计师（1名） 薪资：4K-6k    技术偏向：移动端','任职要求：</br>\n1. 一年以上实际项目开发经验；</br>\n2. 熟练使用Photoshop、Illustrator、dreamweaver、Axure 等软件；</br>\n3. 熟悉HTML语言、CSS脚本等；至少能完成静态网页页面的效果设计；</br>\n4. 要有较丰富的网页制作经验，熟悉页面架构和布局，准确理解需求，对视觉感受负责；</br>\n5. 从事Web / APP网站设计1年以上，熟悉HTML+CSS+JS前端代码的优先（优秀者，不限工作年限）；</br>\n6. 会编辑制作视频以及VR的优先考虑。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(26,13,'13','SEO网络推广（2名） 薪资：4K-6k  ','任职要求:</br>\n1. 电子商务、市场营销、计算机应用专业毕业者优先考虑；</br>\n2. 具有网络工作经验，具有敏锐的市场洞察力、应变能力、创造性的思维能力；</br>\n3. 有一定的沟通能力，有一定的客户服务意识，责任心强，耐心好；</br>\n4. 具备一定的市场分析及判断能力，良好的客户服务意识；</br>\n5. 有责任心，能承受较大的工作压力；</br>\n6. 有团队协作精神，勇于挑战自我；</br>\n7. 有SE0经验、网站推广、网络销售工作经验者优先。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(27,14,'14','网络编辑（文案方向）  2人   2000-4000   ','1、大专及以上学历；</br>\n2、较强的创意、策划能力，良好的文字表达和逻辑思维能力；</br>\n3、熟悉网络推广，微信、微博等营销运作方式；</br>\n4、良好的策略思考能力并能独立撰写文章；</br>\n5、责任心强，能承受一定的工作压力。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(28,14,'15','文案策划    3人    4000-6000','1、大专及以上学历，一年以上医疗相关同岗位工作经验;</br>\n2、善于撰写活动策划方案，具有良好的文字功底及数据分析能力；</br>\n3、具有良好的协调与沟通、思维活跃、敢于创新及良好的团队合作精神；</br>\n4、接受医疗文案工作的优秀应届毕业生（工资面议）。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(29,14,'16','SEM专员  5人  2300-4500','1、大专及以上学历，数学、会计、语言、金融、计算机等专业者优先；</br>\n2、（百度、搜狗、360）竞价相关或相关渠道工作经验；</br>\n3、可接受教育行业、装修行业等相关竞价经验者。 </br>\n','',510000,101,101,101,0,1500000000,1509999999),(30,14,'17','培训专员      2000-4000元','1、大专以上学历，一年以上医疗行业招聘工作经验优先考虑；</br>\n2、可接受人力资源管理专业的优秀应届毕业生；</br>\n3、抗压及执行能力强。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(31,15,'18','UI设计师/手机主题设计        3k-6k','1、负责公司主营业务手机主题的设计/开发/制作（主要包括华为，小米，魅族，OPPO，VIVO，乐视，三星等安卓手机主题平台）</br>\n2、了解手机主题市场制作规范。以及公司Android应用项目UI设计工作，</br>\n3、根据产品原型进行具体效果图设计、视觉设计（包括主次界面风格化，版面布局细节处理，icon绘制等）；</br>\n4、 熟练使用绘图软件（PS,AI等），快速完成主题图标，锁屏，桌面等界面设计制作，手机主题开发者优先录取；</br>\n\n（面试建议）</br>\n熟练使用Photoshop、Illustrator、CorelDraw、Dreamweaver等设计软件（无专业要求、无需全会），对图片制作和视觉效果有较好把控;</br>\n','',510000,101,101,101,0,1500000000,1509999999),(32,15,'19','Android软件开发            5k-10k','1、学历不限，1年以上Android平台开发经验；</br>\n2、精通Android开发，对Android系统有全面的了解，能根据产品设计独立进行应用程序开发；</br>\n3、 熟悉Linux操作系统，掌握常见的数据结构和算法，对数据结构有深入的理解；</br>\n4、熟练掌握Kotlin/Java编程技术，掌握Android常用的网络通信、数据库编程；</br>\n5、熟悉shell、python、JavaScript等脚本语言中的一种；</br>\n\n（面试建议）</br>\n1年以上Android平台开发经验；</br>\n熟悉shell、python、JavaScript等脚本语言中的一种；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(33,16,'20','PHP开发工程师     1人      8000-10000','1、熟练应用PHP开发语言，熟悉面向对象的软件设计方法；\r\n2、具有良好的编程习惯，扎实的编程基础，代码构造清晰、易读；\r\n3、熟悉MySql数据库设计，查询优化；\r\n4、熟悉LAMP/LNMP开发环境，掌握linux常用操作命令优先；\r\n5、能根据业务需求，封装高性能，通用性好的程序接口；\r\n6、具备一定的文档编写能力；\r\n7、会laravel框架\r\n','',510000,101,101,101,0,1500000000,1509999999),(34,16,'21','网站前端开发          1人    6000-8000','1.熟悉内嵌框架；</br>\n2.H5打包成ios或安卓</br>\n3.计算机相关专业,1年以上工作经验，能独立完成前台开发及优化工作；</br>\n4.熟练掌握HTML/XHTML/Javascript/Ajax/XML/Http/CSS等开发技术与网页制作技术，深入了解AJAX的工作原理；</br>\n5.熟练使用JavaScript实现各种常见的效果,保持高效的前端性能优秀代码的可维护性和兼容性，熟练运用jquery进行开发；</br>\n6.熟悉用户交互设计理论，热衷分析并改善产品的用户体验、有较强的学习能力、不断关注前沿技术、良好的问题定位分析和网站优化能力；</br>\n7.具备良好的学习能力以及团队协作能力；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(35,17,'22','UI/平面设计助理','1.专业不限，要有一定的逻辑思维,热爱互联网工作；</br>\n2.有无基础都可以（入职参加岗前训练），但必须对网页设计有兴趣；热爱互联网，喜欢从事网页设计类工作；</br>\n3.学习能力强，工作热情高，富有责任感，在高级网页设计师的指导下完成工作内容；</br>\n4.本岗位欢迎优秀应届毕业生前来应聘。（学习能力强者可宽松学历要求）。</br>','',510000,101,101,101,0,1500000000,1509999999),(36,17,'23','PHP开发助理','1.专业不限，有计算机应用基础优先。</br>\n2.对软件感兴趣。</br>\n3.有志从事于软件大专及以上人员（应往届毕业生、在校生均可）。</br>\n4.热爱IT行业，勤奋、好学。</br>\n5.工作认真负责，善于沟通，具有团队精神。</br>\n6.优秀的逻辑思维能力和学习能力，热爱技术，工作积极，能承受较大的工作压力。</br>\n工作时间：周一~周五早9:00~晚17:30，周末双休</br>','',510000,101,101,101,0,1500000000,1509999999),(37,18,'24','PHP程序员/开发工程师   1人     5000-8000','1、2年以上PHP开发工作经验，有完整web等项目经验；</br>\n2、精通php编程，熟悉PHP模板技术或框架技术，熟练运用MVC框架，良好的OOP思想，有thinkPHP/CI框架开发经验者优先,了解PHP优化、缓存技术；</br>\n3、精通SQL语言，有一定数据库规划能力，熟练MySQL数据库的性能管理及优化；</br>\n4、熟悉HTML5、CSS3、Javascript、XML、Ajax、Jquery、Bootstrap等Web相关技术，有一定前端开发经验者优先；</br>\n5．有代码安全常识，能在代码编写过程中注重安全因素，及运行效率；</br>\n6、具备良好的沟通和学习能力 ，逻辑思维能力较强，计算机相关专业。</br>','',510000,101,101,101,0,1500000000,1509999999),(38,18,'25','前端开发工程师       1人    5000-7000','1、精通各种Web前端技术（HTML/CSS/Javascript等)，熟练跨浏览器、跨终端的开发；</br>\n2、精通至少一种常用的JS开发框架，熟悉面向对象开发模型，具备框架开发能力更好；</br>\n3