序制作流程。</br>\n4. 能熟练使用矢量图形编辑软件。</br>\n5. 思维敏捷，想象力丰富，有较高的美术基础和审美能力，接受力强，有悟性，能独立完成网站和网店美工设计工作。</br>\n\n（面试建议）</br>\n熟练使用矢量图形编辑软件；</br>\n了解html，了解javascript.\n</br>','',510000,101,101,101,0,1500000000,1509999999),(84,35,'68','.NET工程师       3k-6k','1、大专以上学历，2年以上.NET开发经验。</br>\n2、熟练掌握C#、ASP.NET、MSSQL、Javascript、CSS、HTML、jquery等开发语言与技术；</br>\n3、熟悉ASP.NET MVC、ASP.NET WebApi、Entity Framework；</br>\n4、有商城（含微信端）、CRM、ERP等类型项目或其大型项目开发经验者优先；</br>\n\n（面试建议）</br>\n1.2年以上.NET开发经验；</br>\n2.有商城（含微信端）、CRM、ERP等类型项目开发经验者优先；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(85,36,'69','web前端     3人    5k-1ok','1、计算机相关专业、3年以上前端开发经验；</br>\n2、熟练Web网页开发制作，精通HTML5/CSS3/JQuery开发技术；</br>\n3、能使用Javascript/Ajax等编写封装良好的前端交互组件；</br>\n4、掌握移动端Mobile Web页面开发；</br>\n5、熟悉主流浏览器、跨设备问题、深刻理解Web标准，对可用性、可访问性等相关知识有实际的了解和实战经验；</br>\n6、有前端架构选型和设计经验，对网站重构有丰富经验；</br>\n7、思路清晰，积极主动，具备良好的沟通能力和团队协作精神。\n</br>','',510000,101,101,101,0,1500000000,1509999999),(86,36,'70','Android     2人   5-10k','1、本科以上学历，两年以上工作经验，扎实的计算机基础，精通算法、数据结构；</br>\n2、精通java等某种或多种语言，熟悉操作系统、网络编程；</br>\n3、精通Android开发，乐于进行团队合作，执行力强，有责任心。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(87,36,'71','市场推广        3人     6-15k','1、大专以上学历；</br>\n2、普通话标准，音质佳，表达能力强喜欢销售工作，勇于挑战高薪；</br>\n3、个性开朗、反应敏捷，具有较强的事业心与上进心。</br>\n4、负责开拓公司项目市场。与全国甚至全世界相关业务合作。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(88,37,'72','SEO   1人     4-6k','1、相关家装竞价工作经验二年以上；熟悉成都家装行业竞价行情。</br>\n2、熟悉各大搜索引擎营销相关知识，思路清晰，能有效控制推广成本；降低费效比。</br>\n3、具备统计和分析数据的能力，对数据变化有较高的敏锐度，能独立实时完成调整；</br>\n4、熟悉网络推广、优化基本方法理论和计算机常用软件；</br>\n5、熟悉腾讯智慧推，今日头条账户管理优先</br>\n新手勿扰</br>\n','',510000,101,101,101,0,1500000000,1509999999),(89,37,'73','家装设计师     5人     5500~20000','1、室内设计、环境艺术类相关专业；</br>\n2、有较强的设计基础、整装和谈单能力；</br>\n3、责任心强，善于沟通；</br>\n4、有4年以上家装工作经验，敢于挑战高薪。</br>\n5、营销能力强者优先考虑。\n</br>','',510000,101,101,101,0,1500000000,1509999999),(90,38,'74','Java后台开发实习生   4人    3-6K','◆计算机及其相关专业本科以上学历。</br>\n◆优秀应届毕业生或者一年以上软件研发工作经验。</br>\n◆熟练掌握JAVA面向对象编程语言，有良好的编码习惯；； </br>\n◆熟练使用HTML5，JavaScript，Jquery，Ajax，Css3等WEB