br>\n3.精通UI/PS/AI/CorelDRAW等平面设计软件；</br>\n4.熟悉PR、AE等视频编辑软件；\n</br>\n（面试建议）</br>\n精通UI的更吃香哦，如果你还会点视屏剪辑那就更好啦！</br>\n','',510000,101,101,101,0,1500000000,1509999999),(98,42,'82','UI设计师      1人     4000-6000','\n1、对网站、手机界面、软件界面设计等UI设计非常熟悉；</br>\n2、乐于研究设计新的流行趋势并付诸实践；</br>\n3、善于运用设计理论作支撑，感性思考，理性设计；</br>\n4、1年以上工作经验，有相应影响力产品界面设计的积累；</br>\n5、能熟练用各种设计软件（Photoshop、AI和AE等）表达设计需求；</br>\n6、熟练使用axure,skitch,了解开发流程。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(99,42,'83','软件测试工程师   1人    6000-12000','1、3年以上互联网行业测试工作经验；</br>\n2、有较强的分析设计能力和方案整合能力；</br>\n3、熟练运用JMeter、LoadRunner等测试工具和bug管理工具；</br>\n4、熟悉功能测试、自动化测试，性能测试，协助提升产品及平台的正确性及稳定性。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(100,42,'84','PHP开发工程师    1人     6000-12000','1、熟悉Web后端开发，1年以上的PHP等语言开发经验；</br>\n2、熟悉面向对象编程；</br>\n3、熟悉SQL、NoSQL等主流数据库；</br>\n4、有良好的编程风格，能够书写规范、优质的代码；</br>\n5、良好的团队沟通协作能力。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(101,43,'85','前端工程师（8-10k）','1、计算机相关专业本科以上学历，三年以上前端工作经验；</br>\n2、精通HTML、CSS、JS、jQuery等技术，熟悉页面架构和布局 ；</br>\n3、熟练掌握盒模型、各种尺寸屏幕的响应式布局以及浏览器的兼容性；</br>\n4、熟悉Vue.js框架，了解Angular、React等前端主流MVC/MVVM框架，熟练掌握面向对象编程以及事件驱动和数据驱动的编程风格，能够独立完成复杂前端模块设计与实现；</br>\n5、了解AMD/CMD规范，了解grunt/gulp/webpack等前端自动化构建工具；</br>\n6、至少了解一门后台语言（如nodejs、Java、PHP）；</br>\n7、具有良好的沟通能力和团队合作精神、优秀的分析问题和解决问题的能力；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(102,43,'86','PHP工程师（10-12k+）','负责网站系统的开发和升级；</br>\n负责需求分析及技术文档的编写；</br>\n配合前端进行后台代码编写和数据设计；</br>\n学习和研究新技术以满足产品的需求；</br>\n.计算机或相关专业本科以上学历，有扎实的计算机编程理论基础；</br>\n.3年及以上大中型应用系统开发经验，不断追求创新的技术；</br>\n.精通php脚本语言，熟悉面向对象模式及MVC，熟悉设计模式及应用；</br>\n.熟悉MySQL，MongoDB，Redis，Neo4j等储存技术；</br>\n.至少精通一门主流php框架技术，能够根据不同的应用场景分析并选择框架技术；</br>\n.熟悉AJAX、CSS等技术，了解W3C；</br>\n.具有网站系统开发经验，熟悉一般网站的结构模式；</br>\n.能够在lamp环境下开发并部署应用；</br>\n.有积极主动的特质和思维习惯，优秀的团队协作意识，良好抗压能力；</br>\n.具有PHP高性能相关技术使用经验优先；	</br>\n.具有MySQL/PHP/MongoDB/Redis等优秀开源软件源码研究经验优先；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(103,44,'87','网络优化助理（带薪实习：限3人）','1、负责弱电系统方案规划、设计和搭建，做出施工图纸，并以书面形式汇报、跟踪各项弱电建设进度，处理各种紧急情况；</br> \n2、负责陪同销售去面对客户了解客户需求，做出前期设计调整来满足顾客对布线方面的要求； </br>\n3、负责与用户沟通,详细了解需求,完成由设计到施工的管理，到用户工程竣工文档编制、提交的全过程管理。</br>\n4、配合系统工程师完成系统集成项目后期的实施工作。</br>\n5、熟悉计算机及网络相关知识，</br>\n6、工作热情，责任心强，富有创新精神，具有良好的学习能力、分析问题和解决问题的能力； </br>\n7、人际沟通能力强，具有良好的团队协作精神。 </br>\n8、能够执行公司业务流程及工程施工规范，责任心强；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(104,44,'88','智能大厦/综合布线/弱电（带薪实习：限3人）','1、负责弱电系统方案规划、设计和搭建，做出施工图纸，并以书面形式汇报、跟踪各项弱电建设进度，处理各种紧急情况； </br>\n2、负责陪同销售去面对客户了解客户需求，做出前期设计调整来满足顾客对布线方面的要求； </br>\n3、负责与用户沟通,详细了解需求,完成由设计到施工的管理，到用户工程竣工文档编制、提交的全过程管理。</br>\n4、配合系统工程师完成系统集成项目后期的实施工作。</br>\n5、熟悉计算机及网络相关知识，</br>\n6、工作热情，责任心强，富有创新精神，具有良好的学习能力、分析问题和解决问题的能力；</br> \n7、人际沟通能力强，具有良好的团队协作精神。 </br>\n8、能够执行公司业务流程及工程施工规范，责任心强；</br>\n','',510000,101,101,101,0,1500000000,1509999999),(105,45,'89','Web前端工程师  薪资：5k-8k   技术偏向：app开发','  1、Web应用程序的设计与开发；</br>\n  2、Javascript数据处理；</br>\n  3、复杂Ajax交互开发；</br>\n  4、Web接口设计与开发；</br>\n  5、Html/css代码质量控制。</br>\n  6、2年以上前端开发经验，有完整的前端项目经验；</br>\n  7、熟练使用jQuery, Bootstrap等主流Javascript库/框架；</br>\n  8、良好的编码习惯、沟通协作能力和学习能力；</br>\n  9、责任感强，对前端新技术和新应用有浓厚的兴趣。</br>\n','',510000,101,101,101,0,1500000000,1509999999),(106,45,'90','Java工程师（1名）薪资：6k-8k    技术偏向：app开发','1、参与架构师的架构设计，配合项目经理或架构师完成总体项目计划。</br>\n2、配合架构师完成公司系统平台的开发架构（技术选型、技术框架、数据库）。</br>\n3、完成系统的业务模块设计（流程、组件、控件、数据结构） </br>\n4、负责网站开发文档编写工作，包括但不限于：需求文档、开发流程文档、数据库设计文档、bug修复文档、运维调整文档、配合架构师编写开发规范文档。</br>','',510000,101,101,101,0,1500000000,1509999999);
